import React from "react";

const Projects = () => {
  return (
    <section id="projects" className="text-center max-w-4xl mx-auto">
      <h2 className="text-3xl font-bold mb-4">Projects</h2>
      <p className="text-gray-700 mb-4">Here are some of the projects I've worked on recently:</p>
      <div className="grid grid-cols-1 md:grid-cols-2 gap-6">
        <div className="p-4 border rounded shadow">Currency Converter App - Flutter + REST API</div>
        <div className="p-4 border rounded shadow">Customer Management Portal - Java, SAP, SQL</div>
        <div className="p-4 border rounded shadow">Real-time Forecasting - FastAPI + Kafka + AWS</div>
      </div>
    </section>
  );
};

export default Projects;
